class HelloWorldChromeJupiterTest {

    static final Logger log = getLogger(lookup().lookupClass());

    private WebDriver driver; ![1](assets/1.png)

    @BeforeAll
    static void setupClass() {
        WebDriverManager.chromedriver().setup(); ![2](assets/2.png)
    }

    @BeforeEach
    void setup() {
        driver = new ChromeDriver(); ![3](assets/3.png)
    }

    @Test
    void test() {
        // Exercise
        String sutUrl = "https://bonigarcia.dev/selenium-webdriver-java/";
        driver.get(sutUrl); ![4](assets/4.png)
        String title = driver.getTitle(); ![5](assets/5.png)
        log.debug("The title of {} is {}", sutUrl, title); ![6](assets/6.png)

        // Verify
        assertThat(title).isEqualTo("Hands-On Selenium WebDriver with Java"); ![7](assets/7.png)
    }

    @AfterEach
    void teardown() {
        driver.quit(); ![8](assets/8.png)
    }

}
